(1, 'Local Bank', '<p>Make a deposit on this local bank details and then use the form below to append the deposit receipt with this deposit request. we will review your deposit receipt details and add credit to your phpWallet Account.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Bank detail:</strong></p>\r\n<ul>\r\n<li>Account holder: M John Doe</li>\r\n<li>Bank Name: D Bank</li>\r\n<li>Account Number: X734Sg</li>\r\n</ul>\r\n<p>&nbsp;</p>', NULL, '2018-05-21 06:05:00', '2020-08-01 16:26:28', 'http://wallet.ahomaxtechs.com/storage/imgs/qPcJxcGTiPbFsy0LBeK4YMIuSiqHNb02vKLolZ8L.png', 'Your Local Bank Account Number'),
(2, 'myetherwallet', '<p>Please create an ethereum wallet in <a href="https://www.myetherwallet.com/">https://www.myetherwallet.com/</a>&nbsp;and send the amount you want to deposit to your phpWallet Ethereum then send a screenshot of the transaction receipt to the upload field below.</p>', NULL, '2018-07-05 18:20:00', '2020-08-01 16:26:50', 'http://wallet.ahomaxtechs.com/storage/imgs/iAfplw5uTkLfe2XT9ck3L8Drf4VGiwfVxfh6kLp0.png', 'Your Ether Address'),
