(6, 1, 3, 'Changelog', NULL, 'As of phpWallet 2.7 to t we will be writing the updated files in this post please use this post to reffer on how to update.', '<p>&nbsp;</p>\r\n<p><strong style="box-sizing: border-box; color: #545454; font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 16px;">Update ( 28, August 2019 ) V 2.7</strong></p>\r\n<ol>\r\n<li>Added<strong style="box-sizing: border-box; color: #545454; font-family: ''Helvetica Neue'', Helvetica, Arial, sans-serif; font-size: 16px;">&nbsp;</strong>User Impersonation feature</li>\r\n<li>Prepared Twillio for sms notification ( comming in the next version of phpWallet )</li>\r\n<li>Fixed previous versions bugs</li>\r\n<li>Added Mobile Phone number in registration form</li>\r\n<li>Added Blog feature</li>\r\n</ol>\r\n<p>git status for phpWallet</p>\r\n<p>&nbsp;- Reupload The vendor folder</p>\r\n<ul>\r\n<li>&nbsp; &nbsp; &nbsp; &nbsp; modified:&nbsp; &nbsp;app/Http/Controllers/AddCreditController.php</li>\r\n<li>&nbsp; &nbsp; &nbsp; &nbsp; new file:&nbsp; &nbsp;app/Http/Controllers/Auth/error_log</li>\r\n<li>&nbsp; &nbsp; &nbsp; &nbsp; new file:&nbsp; &nbsp;app/Http/Controllers/BlogController.php</li>\r\n<li>&nbsp; &nbsp; &nbsp; &nbsp; modified:&nbsp; &nbsp;app/Http/Controllers/DepositController.php</li>\r\n<li>&nbsp; &nbsp; &nbsp; &nbsp; modified:&nbsp; &nbsp;app/Http/Controllers/ExchangeController.php</li>\r\n<li>&nbsp; &nbsp; &nbsp; &nbsp; modified:&nbsp; &nbsp;app/Http/Controllers/HomeController.php</li>\r\n<li>&nbsp; &nbsp; &nbsp; &nbsp; modified:&nbsp; &nbsp;app/Http/Controllers/IPNController.php</li>\r\n<li>&nbsp; &nbsp; &nbsp; &nbsp; modified:&nbsp; &nbsp;app/Http/Controllers/MerchantController.php</li>\r\n<li>&nbsp; &nbsp; &nbsp; &nbsp; modified:&nbsp; &nbsp;app/Http/Controllers/MoneyTransferController.php</li>\r\n<li>&nbsp; &nbsp; &nbsp; &nbsp; new file:&nbsp; &nbsp;app/Http/Controllers/PayPalController.php</li>\r\n<li>&nbsp; &nbsp; &nbsp; &nbsp; modified:&nbsp; &nbsp;app/Http/Controllers/ProfileController.php</li>\r\n<li>&nbsp; &nbsp; &nbsp; &nbsp; modified:&nbsp; &nbsp;app/Http/Controllers/RequestController.php</li>\r\n<li>&nbsp; &nbsp; &nbsp; &nbsp; modified:&nbsp; &nbsp;app/Http/Controllers/SignUpController.php</li>\r\n<li>&nbsp; &nbsp; &nbsp; &nbsp; new file:&nbsp; &nbsp;app/Http/Controllers/TransactionController.php</li>\r\n<li>&nbsp; &nbsp; &nbsp; &nbsp; modified:&nbsp; &nbsp;app/Http/Controllers/VoucherController.php</li>\r\n<li>&nbsp; &nbsp; &nbsp; &nbsp; modified:&nbsp; &nbsp;app/Http/Controllers/WithdrawalController.php</li>\r\n<li>&nbsp; &nbsp; &nbsp; &nbsp; new file:&nbsp; &nbsp;app/Http/Controllers/error_log</li>\r\n<li>&nbsp; &nbsp; &nbsp; &nbsp; new file:&nbsp; &nbsp;app/Http/Middleware/ForceHttps.php</li>\r\n<li>&nbsp; &nbsp; &nbsp; &nbsp; new file:&nbsp; &nbsp;app/Http/Middleware/ForceNonHttpsToHttp.php</li>\r\n<li>&nbsp; &nbsp; &nbsp; &nbsp; new file:&nbsp; &nbsp;app/Models/Country.php</li>\r\n<li>&nbsp; &nbsp; &nbsp; &nbsp; modified:&nbsp; &nbsp;app/Models/Currency.php</li>\r\n<li>&nbsp; &nbsp; &nbsp; &nbsp; modified:&nbsp; &nbsp;app/Models/DepositMethod.php</li>\r\n<li>&nbsp; &nbsp; &nbsp; &nbsp; modified:&nbsp; &nbsp;app/Models/Merchant.php</li>\r\n<li>&nbsp; &nbsp; &nbsp; &nbsp; new file:&nbsp; &nbsp;app/Models/Post.php</li>\r\n<li>&nbsp; &nbsp; &nbsp; &nbsp; modified:&nbsp; &nbsp;app/Models/Sale.php</li>\r\n<li>&nbsp; &nbsp; &nbsp; &nbsp; modified:&nbsp; &nbsp;app/Models/Transaction.php</li>\r\n<li>&nbsp; &nbsp; &nbsp; &nbsp; modified:&nbsp; &nbsp;app/Models/WithdrawalMethod.php</li>\r\n<li>&nbsp; &nbsp; &nbsp; &nbsp; modified:&nbsp; &nbsp;app/User.php</li>\r\n<li>&nbsp; &nbsp; &nbsp; &nbsp; modified:&nbsp; &nbsp;composer.json</li>\r\n<li>&nbsp; &nbsp; &nbsp; &nbsp; modified:&nbsp; &nbsp;composer.lock</li>\r\n<li>&nbsp; &nbsp; &nbsp; &nbsp; modified:&nbsp; &nbsp;config/app.php</li>\r\n<li>&nbsp; &nbsp; &nbsp; &nbsp; new file:&nbsp; &nbsp;config/twilio.php</li>\r\n<li>&nbsp; &nbsp; &nbsp; &nbsp; new file:&nbsp; &nbsp;metic